import React from 'react'

class Game extends React.Component {
    constructor(props){
        super(props)
        this.game = {
            "correct": "shirt",
            "game_id": 5,
            "guessed": "4aeiouklrtpqmdhszy",
            "player_id": 9,
            "status": "Won",
            "word_id": 357
          }
    }

    render() {
        return (
            <div className="game">
                <div class="col-lg-6">
                    <div class="feature-item">
                        <h2>{this.game.game_id}</h2>
                        <h3>{this.game.status}</h3>
                        <p class="text-muted">Guessed: {this.game.guessed}</p>
                        <p class="text-muted">Correct: {this.game.correct}</p>
                    </div>
                </div>
            </div>
        )
    }
}

export default Game
